import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';


function Login() {

    // inputStyle contenar 
    const inputStyle = makeStyles((theme) => ({
        root: {
            '& > *': {
                margin: theme.spacing(1),
                width: '39ch',
            },
        },
    }));
    const classesa = inputStyle();

    // Datestyle contenar 
    const useStyles = makeStyles((theme) => ({
        container: {
            display: 'flex',
            flexWrap: 'wrap',
        },
        textField: {
            marginLeft: theme.spacing(1),
            marginRight: theme.spacing(1),
            width: 330,
        },
    }));
    const classes = useStyles();





    return (

        <div>
            <form className={classesa.root} noValidate autoComplete="off">
                <TextField id="outlined-basic" label="First Name" variant="outlined" /><br />
                <TextField id="outlined-basic" label="Last Name" variant="outlined" /><br />
                <TextField id="outlined-basic" label="Email" variant="outlined" /><br />
                <TextField id="outlined-basic" label="Password" variant="outlined" /><br />

                <form className={classes.container} noValidate>
                    <TextField
                        id="date"
                        label="Birthday Date"
                        type="date"
                        defaultValue="  "
                        className={classes.textField}
                        InputLabelProps={{
                            shrink: true,
                        }}
                    />
                </form>

            </form>
        </div>
    )
}


export default Login;
